import { Link, NavLink } from "react-router-dom";
import "./styles/menuBar.css";
import cards from "../media/cardss.png";
import video from "../media/play.png";
import tips from "../media/blog.png";
import menus from "../media/menu.png";
import { useState } from "react";
const MenuBar = () => {
  let activeIcon;
  // const [activeIcon, setActiveIcon] = useState();
  const getAttributeIcon = (e) => {
    let active = e.target.getAttribute("icon-name");
    // setActiveIcon(active);
    activeIcon = active;
  };
  return (
    <div className="container-menu-bar">
      <div className="container-menus-bar">
        <div className="link-my-menu">
          <NavLink
            onClick={getAttributeIcon}
            className={({ isActive }) =>
              isActive
                ? {
                    marginTop: "100px",
                  }
                : { marginTop: "50px" }
            }
            to="/menu"
          >
            <img
              className={"icon-menu-bar"}
              icon-name="menu"
              src={menus}
              alt=""
            />
          </NavLink>
        </div>
        <div className="link-my-menu">
          <Link onClick={getAttributeIcon} className="link-element" to="/cards">
            <img
              icon-name="cards"
              className={"icon-menu-bar"}
              src={cards}
              alt=""
            />
          </Link>
        </div>

        <div className="link-my-menu">
          <Link
            onClick={getAttributeIcon}
            className="link-element"
            to="/shorts"
          >
            <img
              icon-name="video"
              className={"icon-menu-bar"}
              src={video}
              alt=""
            />
          </Link>
        </div>
        <div className="link-my-menu">
          <Link onClick={getAttributeIcon} className="link-element" to="/posts">
            <img
              icon-name="blog"
              className={"icon-menu-bar"}
              src={tips}
              alt=""
            />
          </Link>
        </div>
      </div>
    </div>
  );
};

export default MenuBar;
